import React from "react";
import Navbar from "./Navbar";
import { Outlet } from "react-router-dom";

const Layout = () => {
  return (
    <div className="relative min-h-screen">
      <Navbar />
      <div className="pt-32">
        {/* Padding mărit pentru a lăsa spațiu sub navbar */}
        <Outlet />
      </div>
    </div>
  );
};


export default Layout;
